import React, { Component } from 'react';
import '../index.css';
import Navigation from './navbar';



class ViewTutorial extends Component {
    render() {
        return (
            <div>
                <div>
                    <Navigation />
                </div>
                <div>
                    <h1> {this.props.obj.title} </h1>
                </div>
                
            </div>

        )
    }
}

export default ViewTutorial
